    "        return response.text\n",
    "    else:\n",
    "        print(\"Fehler beim Abrufen des Textes von GitHub.\")\n",
    "        return None\n",
    "\n",
    "def analyze_text(text):\n",
    "    return TextBlob(text).sentiment.polarity\n",
    "\n",
    "def plot_sentiment_barchart(polarity):\n",
    "    labels = ['Polarity']\n",
    "    values = [ polarity]\n",
    "\n",
    "    plt.bar(labels, values, color=['blue', 'green'])\n",
    "    plt.xlabel('Sentiment')\n",
    "    plt.ylabel('Score')\n",
    "    plt.title('Sentiment Analysis')\n",
    "    plt.show()\n",
    "\n",
    "if __name__ == \"__main__\":\n",
    "    github_url = \"https://raw.githubusercontent.com/MiMoText/roman18/master/plain/files/Voltaire_Candide.txt\"  # Fügen Sie hier den Link zu Ihrem französischen Text auf GitHub ein\n",
    "    text = fetch_text_from_github(github_url)\n",
    "    if text:\n",
